import React from "react";

const Skills = () => {
  return (
    <div className="container  mx-auto w-full h-full">
      <h1 className="education">Education quality</h1>
      <div className="relative flex overflow-hidden p-10 space-x-52">
        <ol className="relative border-s border-gray-200 dark:border-gray-700">
          <li className="mb-10 ms-4">
            <div className="absolute w-3 h-3 bg-gray-200 rounded-full mt-1.5 -start-1.5 border border-white dark:border-gray-900 dark:bg-gray-700"></div>
            {/* <time className="mb-1 text-sm font-normal leading-none text-gray-400 dark:text-gray-500">
            2016-2022
          </time> */}
            <div className="order-1 bg-gray-400 rounded-lg shadow-xl px-6 py-4 resume-card">
              <div className="flex justify-between">
                <div className="eduction_score_1">
                  <h3 className="mb-2 font-bold text-gray-800 text-xl">
                    B.Tech in Electronics and Communication Engineering.
                  </h3>
                  <p className="mb-3">From Geethanjali college(2016-20)</p>
                </div>
                <div className="flex items-center">
                  <button className="score rounded-lg font-bold">6.7/10</button>
                </div>
              </div>
              <div className=" h-[2px] bg-gray-200 mb-3"></div>
              <div className="text-md leading-snug tracking-wide text-gray-800 text-opacity-100">
                I hold a Bachelor of Technology in Electronics and Communication
                Engineering (ECE) obtained in September 2020 from Geethanjali
                College of Engineering. Throughout my academic journey, I
                maintained a commendable cumulative grade point average of 6.7,
                demonstrating my strong academic capabilities and dedication to
                my field of study. Eager to apply my knowledge and contribute to
                the industry, I am actively seeking opportunities where I can
                leverage my technical expertise and drive innovation.
              </div>
            </div>
          </li>
          <li className="mb-10 ms-4">
            <div className="absolute w-3 h-3 bg-gray-200 rounded-full mt-1.5 -start-1.5 border border-white dark:border-gray-900 dark:bg-gray-700"></div>
            <div className="order-1 bg-gray-400 rounded-lg shadow-xl px-6 py-4 resume-card">
              <div className="flex justify-between">
                <div className="eduction_score_1">
                  <h3 className="mb-2 font-bold text-gray-800 text-xl">
                    B.Tech in Electronics and Communication Engineering.
                  </h3>
                  <p className="mb-3">From Geethanjali college(2016-20)</p>
                </div>
                <div className="flex items-center">
                  <button className="score rounded-lg font-bold">6.7/10</button>
                </div>
              </div>
              <div className="h-[2px] bg-gray-200 mb-3"></div>
              <div className="text-md leading-snug tracking-wide text-gray-800 text-opacity-100">
                The training provided by universities in order to prepare people
                to work in various sectors of the economy or areas of culture.
              </div>
            </div>
          </li>
          <li className="ms-4">
            <div className="absolute w-3 h-3 bg-gray-200 rounded-full mt-1.5 -start-1.5 border border-white dark:border-gray-900 dark:bg-gray-700"></div>
            <div className="order-1 bg-gray-400 rounded-lg shadow-xl px-6 py-4 resume-card">
              <div className="flex justify-between">
                <div className="eduction_score_1">
                  <h3 className="mb-2 font-bold text-gray-800 text-xl">
                    B.Tech in Electronics and Communication Engineering.
                  </h3>
                  <p className="mb-3">From Geethanjali college(2016-20)</p>
                </div>
                <div className="flex items-center">
                  <button className="score rounded-lg font-bold">6.7/10</button>
                </div>
              </div>
              <div className="h-[2px] bg-gray-200 mb-3"></div>
              <div className="text-md leading-snug tracking-wide text-gray-800 text-opacity-100">
                The training provided by universities in order to prepare people
                to work in various sectors of the economy or areas of culture.
              </div>
            </div>
          </li>
        </ol>
      </div>
    </div>

    // <div className="h-screen flex justify-center items-center">
    //   <div className="max-w-xl mx-auto w-full">
    //     <h4 className="text-3xl md:text-5xl dark:text-white font-bold mb-6">
    //       Skills
    //     </h4>

    //     <div className="mb-7">
    //       <div className="flex justify-between py-1">
    //         <span className="text-base text-gray-lite font-semibold dark:text-[#A6A6A6]">
    //           Web Design
    //         </span>
    //         <span className="text-base font-semibold text-gray-lite pr-5 dark:text-[#A6A6A6]">
    //           80%
    //         </span>
    //       </div>
    //       <svg
    //         className="rc-progress-line"
    //         viewBox="0 0 100 1"
    //         preserveAspectRatio="none"
    //       >
    //         <path
    //           className="rc-progress-line-trail"
    //           d="M 0.5,0.5 L 99.5,0.5"
    //           strokeLinecap="round"
    //           stroke="#D9D9D9"
    //           strokeWidth="1"
    //           fillOpacity="0"
    //         ></path>
    //         <path
    //           className="rc-progress-line-path"
    //           d="M 0.5,0.5 L 99.5,0.5"
    //           strokeLinecap="round"
    //           stroke="#FF6464"
    //           strokeWidth="1"
    //           fillOpacity="0"
    //           style={{
    //             strokeDasharray: "79.2px, 100px",
    //             strokeDashoffset: "0px",
    //             transition:
    //               "stroke-dashoffset 0.3s ease 0s, stroke-dasharray 0.3s ease 0s, stroke 0.3s linear 0s, 0.06s",
    //           }}
    //         ></path>
    //       </svg>
    //     </div>

    //     {/* Other skill sections */}
    //   </div>
    // </div>
  );
};

export default Skills;
